import React from "react";
import "./App.css";

function App() {
  return (
    <div>
      <h1>My Ugly Little To Do List</h1>
      <p>Gurl, don't give up.</p>
      <ul>
        <li>Thing1</li>
        <li>Thing2</li>
        <li>Thing3</li>
      </ul>
    </div>
  );
}

export default App;
